import React, { Component } from 'react';
import './App.css';
import FormBootstrapAsDependency from './FormBootstrapAsDependency';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1 style={{textAlign:'center'}}>Reserva de Mediamentos</h1>
        <FormBootstrapAsDependency />
      </div>
    );
  }
}

export default App;
